#!/bin/bash
set -eux
set -o pipefail

# env >&2 | tee --append /home/pete/wefwefwef/supergreen.git/logz.txt
printf '\n%s\n\n' "$*" |& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt

printf ' LC_ALL=%s\n' "$(echo "$LC_ALL")" |& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt
printf ' PATH=%s\n' "$(echo "$PATH")" |& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt
printf ' VSLANG=%s\n' "$(echo "$VSLANG")" |& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt

final=''
for arg in "$@"; do
	case "$arg" in
		*/*)
			show=!
			if [[ -f "$arg" ]]; then
				show=''
			elif [[ -d "$arg" ]]; then
				show=d
			else
				final="$arg"
			fi
			printf '  --> %s\t%s <--\n' "$show" "$arg" \
				|& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt
			;;
		*)  ;;
	esac
done


# exec "$@"

# shift 1 ; exec "$@"
# /usr/bin/cc

# exit 42

# exec /usr/bin/cc "$@" \
/usr/bin/cc "$@" \
	|& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt

if [[ "$final" != '' ]]; then
	ls -lha "$final" \
		|& tee --append /home/pete/wefwefwef/supergreen.git/logz.txt
	# Looks like final output is always a file
	if [[ -d "$final" ]]; then
		exit 42
	fi
fi


